import queue

def update_and_query_reviews(operations):
    upper = queue.PriorityQueue()
    under = queue.PriorityQueue()
    nreview = 1
    results = []
    for operation in operations:
        if operation[0] == 1:
            x = operation[1]
            nreview += 1
            if nreview < 3:
                under.put(-x)
            elif nreview == 3:
                under.put(-x)
                upper.put(-under.get())
            else:
                c = upper.queue[0]
                d = -under.queue[0]
                if upper.qsize() == nreview // 3:
                    if c >= x:
                        under.put(-x)
                    else:
                        upper.get()
                        upper.put(x)
                        under.put(-c)
                elif d > x:
                    upper.put(-under.get())
                    under.put(-x)
                else:
                    upper.put(x)
        elif operation[0] == 2:
            if nreview < 3:
                results.append('No reviews yet')
            else:
                results.append(upper.queue[0])
    return results

